import './Header.css';

const Header = () => {
    return (
        <div className='header_container'>
            <div className='header'>
                <div className='header_left'>Left</div>
                <div className='header_middle'>Middle</div>
                <div className='header_right'>Right</div>
            </div>
        </div>
    );
}

export default Header;
